import img1 from './img/bi.png';
import img2 from './img/toss-bank.svg';

const imageLibrary = [
    { id: 1, src: img1, alt: '브랜드 이미지' },
    { id: 2, src: img2, alt: '토스뱅크 로고' },
];

export default imageLibrary;
